import './App.css';
import {Route, BrowserRouter, Routes} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' />
        <Route path='/home' />
        <Route path='/countries' />
        <Route path='activities'/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
